import { Cancel } from "@mui/icons-material";
import React, { FC, useState } from "react";

export interface CardProps {
  id?: string;
  name?: string;
  cmc?: number;
  imageSrc: string;
  scryfallUrl: string;
  cardName: string;
}

const CardOverlayIcon: FC<{ image?: string; url: string }> = ({
  image,
  url,
}) => {
  return (
    <img
      className="w-1/4 hover:scale-110 duration-300"
      onClick={() => {
        window.open(url, "_blank");
      }}
      src={
        image ??
        "data:image/jpeg;base64,"
      }
    />
  );
};

export default function MtgCard({
  imageSrc,
  scryfallUrl,
  cardName,
}: CardProps) {
  const [showOverlay, setShowOverlay] = useState(false);
  const CardOverlay = () => {
    return (
      <div className="absolute inset-0 cursor-pointer bg-black bg-opacity-70 flex flex-col items-center justify-center gap-6">
        <button
          className="absolute top-2 right-2 duration-300 hover:shadow-[0px_0px_15px_white] rounded-full"
          onClick={() => setShowOverlay(false)}
        >
          <Cancel />
        </button>

        <CardOverlayIcon url={scryfallUrl} />
        <CardOverlayIcon
          image="data:image/png;base64,"
          url={`https://www.mtg-asia.com/search?type=product&options%5Bprefix%5D=last&q=${encodeURIComponent(
            cardName
          )}`}
        />
        <CardOverlayIcon
          image="data:image/png;base64,"
          url={`https://www.greyogregames.com/search?page=1&q=${encodeURIComponent(
            cardName
          )}`}
        />
      </div>
    );
  };

  return (
    <div>
      <div className="relative">
        <img
          className="rounded-2xl cursor-pointer sm:hover:scale-110 duration-300"
          src={imageSrc}
          onClick={() => {
            setShowOverlay(true);
          }}
        />
        {showOverlay && (
          <div className="absolute inset-0 h-full">
            <CardOverlay />
          </div>
        )}
      </div>
    </div>
  );
}
